import React from "react";
import backgroundimage from "./images/kelli-mcclintock-wBgAVAGjzFg-unsplash.jpg";
import "../style.css";

function Dashboard() {
  return (
    <div className="bg-slate-50">
      {/* Full-Width Section with Background Image */}
      <div className="row align-items-center text-white vh-100 bg-dark">
        {/* Background Image */}
        <img
          src={backgroundimage}
          className="img-fluid w-100 h-100 position-absolute top-0 start-0"
          alt="Background"
          style={{ objectFit: "cover", zIndex: "-1" }}
        />

        {/* Left Column (Empty) */}
        <div className="col-lg-6 d-none d-lg-block"></div>

        {/* Right Column (Text Content) */}
        <div className="col-lg-6 text-end p-5">
          <h1 className="shadow-lg display-6 hometype p-3">
            THE HOME OF MILITARY MENTAL HEALTH
          </h1>
        </div>
      </div>

      {/* Mission Section */}
      <div className="py-5">
        <div className="container">
          <div className="row">
            {/* Spacer Column */}
            <div className="col-lg-2"></div>

            {/* Content Column */}
            <div className="col-lg-8 bg-slate-200 p-4 rounded">
              <h1 className="mb-3">Our Mission</h1>
              <p>
                The Lemich Clinic for Military Mental Health was founded on the
                belief that everyone who serves should have access to high
                quality, confidential, mental health care. The majority of our
                clients are active duty sailors at Naval Station Norfolk. We
                also see service members from the other military installations
                in Virginia. We also work with military spouses and recent
                veterans. If you are a first responder or outside the military,
                contact us to see if you qualify for our program.
              </p>
            </div>

            {/* Spacer Column */}
            <div className="col-lg-2"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
